import React from 'react';
import '../styling/Home.css';
import  placeholder  from './placeholder.jpeg'

export default function Home() {

    return(
        <div class="home-container">
            <div class="top"></div>
            <div class="middle">
                <div class="side"></div>
                <img id="home-photo" src={placeholder}></img>
                <div class="side"></div>
            </div>
            <div class="top"></div>

        </div>
    )
}
